%[text] # example for importance sampling of SRP (Cook–Torrance model)
%[text] モンテカルロ積分に使う乱数の数は `nMCintUni & nMCintImp`
%[text] `それを nMC` 回行って平均と分散を計算し，plotする．（ややこしい）
clc
clear
cls

format long
%[text] ## Monte-Carlo condition & pre-allocation
nMC = 100;

srpTrue = zeros(nMC, 3);
srpImp = zeros(nMC, 3);
%[text] ## object
sat = readSC('flatPlate.obj', 1) %[output:96b2b8cb] %[output:72962e06] %[output:864f2f7d] %[output:4a566874]
showSC(sat); %[output:69a6ad6b]

nFacet = size(sat.faces,1);
sat.rho = 0.5 .* ones(nFacet,1);
sat.F0 = 0.5 .* ones(nFacet,1);
sat.mCT = 0.45 .* ones(nFacet,1);

const = orbitConst;
d = au2km(1, const) * 10^3; % m
dAU = km2AU(d ./ 10^3, const); % AU
S0 = const.S0; % Solar constant, W/m^2
c = const.c; % light speed, m/s
coeff = -S0 / c / dAU^2;
%[text] ## Cook–Torrance model
thetaI = deg2rad(35);
phiI = deg2rad(40);

sunB = [sin(thetaI)*cos(phiI), sin(thetaI)*sin(phiI), cos(thetaI)];
sunB = sunB ./ norm(sunB);

% Monte-Carlo integration condition
nMCintUni = [100,500, 1000, 5000, 10000, 50000, 100000];
% nMCintUni = 100:500:100000;
% nMCintUni = [10^3 10^4];

tic
for i = 1:length(nMCintUni)
    N = nMCintUni(i);
    for j = 1:nMC
%[text] ## speuclar only, uniform distribution
        [~, ~, srpCs] = srpCTuni(sat, sunB, d, const, 'Beckmann', N);

        srpTrue(j,:) = srpCs;
    end
    stdTrue(i,:) = std(srpTrue);
    meanTrue(i,:) = mean(srpTrue);
end
toc %[output:2bc3377b]
%[text] ## importance sampling
% Monte-Carlo integration condition
nMCintImp = [10 1000];
nMCintImp = nMCintUni;

tic
%[text] #### transform to local frame
eAngle = acos(sat.normal(:,3));
eAxis = cross(repmat([0 0 1],nFacet,1), sat.normal) .* (eAngle > 1e-5) ...
    + repmat([0 0 1],nFacet,1) .* (eAngle < 1e-5) ...
    + repmat([1 0 0],nFacet,1) .* (eAngle > pi-1e-5); % normal vectorがほぼ[0 0 -1]のとき
eAxis = eAxis ./ vecnorm(eAxis, 2, 2);

% quaternion from body-fixed frame to local frame
qlb = [eAxis.*sin(eAngle/2), cos(eAngle/2)]; % nFacet x 4

% sun vector and normal vectors at local frame (normal vector is along z-axis)
sLocal = qRotation(4, repmat(sunB,nFacet,1), qlb); % nFacet x 3
nLocal = qRotation(4, sat.normal, qlb); % nFacet x 3

NS = sat.normal * sunB'; % nx1

for i = 1:length(nMCintImp)
    N = nMCintImp(i);
    for j = 1:nMC
        [~, ~, srpCs] = srpCT(sat, sunB, d, const, 'Beckmann', N);

        srpImp(j,:) = srpCs;
    end
    stdImp(i,:) = std(srpImp);
    meanImp(i,:) = mean(srpImp);
end

toc %[output:7016d875]

%[text] ## show FIgs
figure %[output:48d9f999]
tiledlayout(3,1), nexttile %[output:48d9f999]
plotStd(nMCintUni, meanTrue(:,1), 3*stdTrue(:,1), 'r'), hold on %[output:48d9f999]
plotStd(nMCintImp, meanImp(:,1), 3*stdImp(:,1), 'b', 'b'); %[output:48d9f999]

nexttile %[output:48d9f999]
plotStd(nMCintUni, meanTrue(:,2), 3*stdTrue(:,2)); hold on %[output:48d9f999]
plotStd(nMCintImp, meanImp(:,2), 3*stdImp(:,2),'b', 'b'); %[output:48d9f999]

nexttile %[output:48d9f999]
plotStd(nMCintUni, meanTrue(:,3), 3*stdTrue(:,3)); hold on %[output:48d9f999]
plotStd(nMCintImp, meanImp(:,3), 3*stdImp(:,3), 'b', 'b'); %[output:48d9f999]

disp('mean') %[output:5378d90d]
[meanTrue(end,:) %[output:group:92137a4a] %[output:577491b1]
    meanImp(end,:)] %[output:group:92137a4a] %[output:577491b1]

disp('standrad deviation') %[output:1f134fbd]
[stdTrue(end,:) %[output:group:6f957756] %[output:68ce8ffb]
    stdImp(end,:)] %[output:group:6f957756] %[output:68ce8ffb]

